css:
.editor-colors {
  background-color: #252525;
  color: #929292;
}
.editor {
  background-color: #252525;
  color: #929292;
}
.editor .wrap-guide {
  background-color: #333233;
}
.editor .indent-guide {
  color: #606061;
}
.editor .invisible-character {
  color: #333233;
}
.editor .gutter {
  background-color: #333233;
  color: #929292;
}
.editor .gutter .line-number.cursor-line {
  background-color: #606061;
  color: #929292;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #929292;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #929292;
}
.editor .invisible {
  color: #929292;
}
.editor .cursor {
  color: #ffffff;
}
.editor .selection .region {
  background-color: #403f40;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #929292;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #606061;
}
.entity.name.type {
  color: #bd961e;
}
.entity.other.inherited-class {
  color: #bd961e;
}
.keyword {
  color: #929292;
}
.keyword.control {
  color: #729519;
}
.keyword.operator {
  color: #929292;
}
.keyword.other.special-method {
  color: #0d9ffc;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #bd961e;
}
.constant.punctuation,
.constant.boolean {
  color: #01bbbc;
}
.constant.character.escape {
  color: #01bbbc;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.variable {
  color: #bd961e;
}
.constant.other.color,
.constant.other.symbol {
  color: #01bbbc;
}
.variable {
  color: #01bbbc;
}
.variable.interpolation {
  color: #474747;
}
.variable.parameter.function {
  color: #929292;
}
.variable.other.block {
  color: #0d9ffc;
}
.invalid.illegal {
  background-color: #bd1c10;
  color: #252525;
}
.string {
  color: #01bbbc;
}
.string.regexp {
  color: #01bbbc;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #bd1c10;
}
.string .variable.other.constant {
  color: #0d9ffc;
}
.string .meta.embedded.line {
  color: #929292;
}
.punctuation.separator {
  color: #929292;
}
.punctuation.definition.comment {
  color: #606061;
}
.punctuation.definition.string {
  color: #bd1c10;
}
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #929292;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #0d9ffc;
}
.punctuation.definition.bold {
  color: #bd961e;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bd1c10;
}
.support.class {
  color: #bd961e;
}
.support.function {
  color: #929292;
}
.support.function.any-method {
  color: #606061;
}
.entity.name.function {
  color: #0d9ffc;
}
.entity.name.class,
.entity.name.type.class {
  color: #bd961e;
}
.entity.name.section {
  color: #0d9ffc;
}
.entity.name.tag {
  color: #bd1c10;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #0d9ffc;
}
.meta.class {
  color: #bd961e;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #0d9ffc;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #606061;
  color: #929292;
}
.none {
  color: #929292;
}
.markup.bold {
  color: #de935f;
  font-style: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #bd1c10;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #0d9ffc;
}
.markup.inserted {
  color: #729519;
}
.markup.list {
  color: #bd1c10;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #729519;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #729519;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
